package javaprogrammes;

import java.util.Scanner;

public class multiplication {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		Scanner s=new Scanner(System.in);
		int num=s.nextInt();
		for (int i=1;i<=10;i++) {
			System.out.println(num*i);
		}
		
		

	}

}
